.hr-text {
    display: flex;
    align-items: center;
    justify-content: center;
    width: 100%;
    margin: 10px 0 20px;
    position: relative;
}

.hr-text::before,
.hr-text::after {
    content: '';
    flex-grow: 1;
    border-bottom: 1px solid #8b9197; /* Line color */
    margin: 0 10px;
    height: 0; /* Height should be 0 for a border-bottom to work */
}

.hr-text span {
    position: relative;
    padding: 0 10px;
    background-color: var(--card-background-color) !important; /* Match the card background */
    z-index: 2; /* Ensure the text stays above the line */
    color: rgb(var(--heading-text-color)) !important; /* Change the text color dynamically */
    font-size: 1rem;
}


/* Custom button styles */
#btnCredentials {
    background-color: var(--card-background-color) !important;
    border: 1px solid var(--bs-link-color) !important;
    color: var(--bs-link-color) !important;
    padding: 0.4rem 1rem;
    display: inline-flex;  /* Use flex to align icon and text */
    align-items: center;  /* Center content vertically */
    justify-content: center;  /* Center content horizontally */
    transition: all 0.3s ease !important;  /* Smooth transition for hover */
    transform: translateY(0) !important;  /* Ensure initial position */
}

/* Ensure the span inside the button has no independent hover effect */
#btnCredentials .btn-text {
    color: var(--bs-link-color) !important;
