const focusOnFirstInputElement = () => {
    try {
        document.getElementById("username").focus();
    } catch (error) {
        console.error("Error focusing on the first input element:", error);
    }
};

// Stop the back button
try {
    window.history.pushState(null, null, window.location.href);
    window.onpopstate = function () {
        window.history.go(1);
    };
} catch (error) {
    console.error("Error setting up back button prevention:", error);
}

// Shade username as red on focus
try {
    document.getElementById('username').addEventListener('focus', function () {
        $('#username').css('border', '1px solid red');
        checkInputsPasswordless();
    });
} catch (error) {
    console.error("Error adding focus event listener to username input:", error);
}

// Shade password as red on focus
try {
    document.getElementById('password').addEventListener('focus', function () {
        $('#password').css('border', '1px solid red');
        checkInputsPasswordless();
    });
} catch (error) {
    console.error("Error adding focus event listener to password input:", error);
}

// Get references to input fields, buttons, and elements
let usernameInput, passwordInput, submitBtn, togglePasswordlessSwitch, passwordlessSubmit, passwordElement, toggleLabel;
try {
    usernameInput = document.getElementById('username');
    passwordInput = document.getElementById('password');
    submitBtn = document.getElementById('btnSignIn');
    togglePasswordlessSwitch = document.getElementById('togglePasswordlessSwitch');
    passwordlessSubmit = document.getElementById('btnPasswordless');
    passwordElement = document.getElementById('passwordContainer');
    toggleLabel = document.getElementById('toggleLabel');
} catch (error) {
    console.error("Error getting references to input fields and buttons:", error);
}

let authMethod = 'password';
console.log("Initial auth method:", authMethod);

if (togglePasswordlessSwitch) {
    togglePasswordlessSwitch.addEventListener('change', function () {
        try {
            console.log("Passwordless switch toggled.");

            if (togglePasswordlessSwitch.checked) {  // Switch to passwordless
                passwordElement.style.display = 'none';
                passwordlessSubmit.style.display = 'block';
                submitBtn.style.display = 'none';
                toggleLabel.textContent = 'Sign in With Password';
                authMethod = 'passwordless';

                // Remove password listeners, add passwordless listeners
                usernameInput.removeEventListener('input', checkInputsPassword);
                passwordInput.removeEventListener('input', checkInputsPassword);
                usernameInput.addEventListener('input', checkInputsPasswordless);

            } else {  // Switch back to password
                passwordElement.style.display = 'block';
                passwordlessSubmit.style.display = 'none';
                submitBtn.style.display = 'block';
                authMethod = 'password';
                toggleLabel.textContent = 'Login Passwordless';

                // Remove passwordless listeners, add password listeners
                usernameInput.removeEventListener('input', checkInputsPasswordless);
                usernameInput.addEventListener('input', checkInputsPassword);
                passwordInput.addEventListener('input', checkInputsPassword);
            }
            console.log("Auth method after toggle:", authMethod);
        } catch (error) {
            console.error("Error toggling authentication method:", error);
        }
    });
}


// Functions to check input fields for enabling/disabling the submit button
function checkInputsPassword() {
    try {
        if (usernameInput.value && passwordInput.value) {
            submitBtn.classList.remove('disabled');
            $('#username').css('border', '1px solid #8b9197');
            $('#password').css('border', '1px solid #8b9197');
        } else {
            submitBtn.classList.add('disabled');
            $('#password').css('border', '1px solid red');
        }
    } catch (error) {
        console.error("Error checking inputs for password authentication:", error);
    }
}

function checkInputsPasswordless() {
    try {
        if (usernameInput.value) {
            passwordlessSubmit.classList.remove('disabled');
            $('#username').css('border', '1px solid #8b9197');
        } else {
            passwordlessSubmit.classList.add('disabled');
            $('#username').css('border', '1px solid red');
        }
    } catch (error) {
        console.error("Error checking inputs for passwordless authentication:", error);
    }
}

// Add event listeners for input fields depending on the auth method
if (authMethod === 'password') {
    try {
        usernameInput.addEventListener('input', checkInputsPassword);
        passwordInput.addEventListener('input', checkInputsPassword);
    } catch (error) {
        console.error("Error adding input event listeners for password authentication:", error);
    }
} else if (authMethod === 'passwordless') {
    try {
        console.log("validating username");
        usernameInput.addEventListener('input', checkInputsPasswordless);
    } catch (error) {
        console.error("Error adding input event listener for passwordless authentication:", error);
    }
}

// Control Enter key functionality
try {
    var form = document.getElementById('usernamePasswordForm');
    var pwdSubmitBtn = document.getElementById('btnSignIn');
    var passwordlessSubmitBtn = document.getElementById('btnPasswordless');

    form.addEventListener('keydown', function (event) {
        try {
            if (event.key === "Enter") {
                console.log("Enter key pressed.");
                event.preventDefault(); // Prevent the default action
                if (authMethod === 'password') {
                    console.log("Submitting form with password authentication.");
                    pwdSubmitBtn.click(); // Trigger the button click
                } else if (authMethod === 'passwordless') {
                    console.log("Submitting form with passwordless authentication.");
                    passwordlessSubmitBtn.click();
                } else {
                    console.log("Unexpected auth method.");
                }
            }
        } catch (error) {
            console.error("Error handling keydown event in form:", error);
        }
    });
} catch (error) {
    console.error("Error setting up Enter button functionality:", error);
}

// Caps Lock warning
try {
    var input = document.getElementById("password");
    var text = document.getElementById("passwordFeedback");

    input.addEventListener("keyup", function (event) {
        try {
            if (event.getModifierState("CapsLock")) {
                text.style.display = "block";
            } else {
                text.style.display = "none";
            }
        } catch (error) {
            console.error("Error handling keyup event in password input:", error);
        }
    });
} catch (error) {
    console.error("Error adding keyup event listener to password input:", error);
}
