// Function to check the input values and remove disabled if both are not empty
function checkInputs() {
  if (usernameInput.value) {
    // If  fields have values, remove the disabled class from the submit button, and clear red shading
    submitBtn.classList.remove('disabled');
    credentialsBtn.classList.remove('disabled');


    $('#username').css('border', '1px solid #8b9197');
  } else {
    // Optional: Add the class back if either field is empty, and add red shading
    if (!submitBtn.classList.contains('disabled')) {
      submitBtn.classList.add('disabled');
      credentialsBtn.classList.add('disabled');

      $('#username').css('border', '1px solid red');
    }
  }
}

usernameInput.addEventListener('input', checkInputs);

