module.exports = a = async ({params}) => {
    const details = params.details;

    const secondsUntilUnlock = details[0]?.rawResponse?.details?.[0]?.innerError?.secondsUntilUnlock ?? null;

    // If secondsUntilUnlock is not available, return a specific message
    const formattedTime = secondsUntilUnlock !== null ? formatTime(secondsUntilUnlock) : null;

    const message = formattedTime 
        ? `Too many unsuccessful sign-on attempts. Your account will unlock in ${formattedTime}.`
        : "Too many unsuccessful sign-on attempts. Your account is currently locked. Please try again later.";

    return { 'message': message };
}

// Function to format time into a human-readable string
const formatTime = (seconds) => {
    const years = Math.floor(seconds / (365 * 24 * 3600));
    const days = Math.floor((seconds % (365 * 24 * 3600)) / (24 * 3600));
    const hours = Math.floor((seconds % (24 * 3600)) / 3600);
    const minutes = Math.ceil((seconds % 3600) / 60);

    const parts = [];
    if (years > 0) parts.push(`${years} year${years > 1 ? 's' : ''}`);
    if (days > 0) parts.push(`${days} day${days > 1 ? 's' : ''}`);
    if (hours > 0) parts.push(`${hours} hour${hours > 1 ? 's' : ''}`);
    if (minutes > 0) parts.push(`${minutes} minute${minutes > 1 ? 's' : ''}`);

    return parts.join(', ');
}

