form-control,.form-control:focus {  color: var(--text-color-primary) !important;  border-radius: var(--form-control-border-radius) !important;}/*  FORM CONTROL PLACEHOLDER FONT COLOR  */.form-floating input+label {  color: rgba(var(--text-color-primary), var(--text-color-muted-apha)) !important;}/*  FORM CONTROL HIGHLIGHT  */.form-control:focus {  border-color: rgba(var(--focus-highlight-color), .5) !important;  box-shadow: 0 0 0 0.25rem rgba(var(--focus-highlight-color), 0.25) !important;}/*  PRIMARY BUTTON  */.btn-primary {  /*  font color  */  --bs-btn-color: var(--button-primary-text-color) !important;  /*  font color when hovering  */  --bs-btn-hover-color: var(--button-primary-text-color) !important;  /*  border color  */  --bs-btn-border-color: var(--button-primary-background-color) !important;  /*  background color  */  --bs-btn-bg: rgb(var(--button-primary-background-color)) !important;  /*  background color when hovering  */  --bs-btn-hover-bg: rgba(var(--button-primary-background-color), var(--button-hover-alpha)) !important;  /*  background color when active  */  --bs-btn-active-bg: rgba(var(--button-primary-background-color), var(--button-active-alpha)) !important;  /*  background color when disabled  */  --bs-btn-disabled-bg: rgba(var(--button-primary-background-color), var(--button-disabled-alpha)) !important;  background-color: rgb(var(--button-primary-background-color)) !important;  border-color: rgb(var(--button-primary-background-color)) !important;  color: var(--button-primary-text-color) !important;  border-radius: var(--button-primary-border-radius);}.btn-primary:hover {  background-color: rgba(var(--button-primary-background-color), var(--button-hover-alpha)) !important;  border-color: rgba(var(--button-primary-background-color), var(--button-hover-alpha)) !important;  color: var(--button-primary-text-color) !important;}/*  LINK BUTTON  */.btn-link {  /*  button font color  */  --bs-btn-color: rgb(var(--link-button-primary-color)) !important;  /*  button font color when active  */  --bs-btn-active-color: rgba(var(--link-button-primary-color), var(--button-active-alpha)) !important;  /*  button font color when hovering  */  --bs-btn-hover-color: rgba(var(--link-button-primary-color), var(--button-hover-alpha)) !important;  /*  button font color when disabled  */  --bs-btn-disabled-color: rgba(var(--link-button-primary-color), var(--button-disabled-alpha)) !important;  color: rgb(var(--link-button-primary-color)) !important;}/*  POLLING INDICATORS  */.css-11k6vsm,.css-17zi2ag,.css-139roxj {  /* width: 20px; */  /* height: 20px; */  /* animation-duration: 0.75s; */  /*  circle background color  */  background-color: var(--polling-indicator-color) !important;}/*  BUTTON ACTIVITY INDICATOR, PROGRESS SPINNER  */.css-sw2ho0 {  /*  spinning circle color  */  --primary-color: var(--activity-indicator-color) !important;}/* PROGRESS SPINNER */.spinner-color {  color: var(--polling-indicator-color) !important;}.card-body.p-5.d-flex.flex-column {  border-radius: var(--card-body-border-radius);}.card.shadow.mb-5 {  border-radius: var(--card-body-border-radius);  box-shadow: 1px 1px 3px 1px var(--card-shadow-color) !important;}"
